// components/Header.js
import Link from "next/link";

import "./Header.scss";
import NavBar from './NavBar'

const Header = props => (
  <Link href="/">
    <div className="Header"><img src = "../public/img/logo.png" alt="spinevision logo"></img>
    
    </div>
    
  </Link>
  
);

export default Header;
